import s from './BlockTeam.module.css'
import React from "react";


let BlockTeam = (props) => {
//console.log(props);
    let comandos = props.BlockTeam.map(e=>

        <div className={s.item}>
            <div className={s.img}><img src={e.img} alt=''/> </div>
            <div className={s.name}> {e.name} </div>
            <div className={s.title}> {e.title} </div>
        </div>


    );

    return(
        <div className={s.block}>
            <h1 className={s.title}> meet the team</h1>
           <div className={s.comandos}> {comandos}</div>

        </div>
    );
};
export default BlockTeam;
